import './App.css';
import Login from './App/Login/Login.js';

function App() {
  return (
    <div className="App">
      <div className='App-Logo'>
        <p className='App-Logo-Text-Christy'>CHRISTY</p>
        <p className='App-Logo-Text-PAH'>Plumbing & Heating</p>
      </div>
      <Login />
    </div>
  );
}

export default App;
